const { default: WhoWeHelp_Title } = require("./WhoWeHelp_Title");


let WhoWeHelp = () =>{
    return(
        <section className="WhoWeHelp">
            <WhoWeHelp_Title />
            <a className="WhoWeHelp_A"></a>
            {/* <WhoWeHelp_ThreeColumns /> */}
            <ToDoList />
            <WhoWeHelp_Text />
            <WhoWeHelp_Fundactions />

        </section>
    )
}

export default WhoWeHelp
